    namespaced: true,
    state: {
        list: [],//
        souecelist: [],//
        talRow: 0,//
        totalRow: 0, //
        advisory: [],//
        sum: 0,//
        listtype: [], //
        tasum: 0, // 
        customerTyplist: [],//
        total: 0, //
        objdetail: {}, //
        contacts: [],//
        specialty: [],//
        total: 0, //
        educationlist: [], //
