    },
    actions: {
        // 
        async getcustomer({ commit }, { pageNo, pageSize, id, name, mobile,
            wechat,
            qq,
            appellation,
            sex,
            visitortype,
            age,
            searchTerms,
            website,
            school,
            education,
            graduatedSchool,
            proposedMajor,
            source,
            lastAt,
            customerType,
            remarks,
            createAt,
            createAc,
            salesman,
            state,
            advisory, }) {
            try {
                let res = await api.getcustomer({
                    pageNo, pageSize, id, name, mobile,
                    wechat,
                    qq,
                    appellation,
                    sex,
                    visitortype,
                    age,
                    searchTerms,
                    website,
                    school,
                    education,
                    graduatedSchool,
                    proposedMajor,
                    source,
                    lastAt,
                    customerType,
                    remarks,
                    createAt,
                    createAc,
                    salesman,
                    state,
                    advisory,
                })
                if (res.code === 200) {
                    commit("setuserlist", res.data)
                    commit('settotalRow', res.totalRow)
                } else {
                    localStorage.setItem("showbox",true)
                    Message.error(res.msg)
                }
                console.log(res, "")
            } catch (err) {
                console.log(err)
            }
        },
